(2409, 1, 'system/product/create', 'POST', '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/93.0.4577.82 Safari/537.36', '{\"kind\":\"0\",\"_token\":\"11tKwsFfwqqZtdNS3dNYIVmHxR091RNQcXqgawPq\",\"descriptions\":{\"en\":{\"name\":\"Jordan 1 Retro High Light Smoke Grey\",\"keyword\":\"jordan 1\",\"description\":\"Jordan delivered another new colorway of their most popular silhouette with the Jordan 1 Retro High Light Smoke Grey, now available on StockX. Following a similar reconstructed design language as the Jordan 1 Union LA from 2018, this Jordan 1 utilizes color blocking and different materials to present familiar colors in a unique format.\\r\\n\\r\\nThe Jordan 1 High Light Smoke Grey is composed of a white leather upper with grey suede overlays and a red leather ankle panel. Black suede on the heel paneling and Swoosh, a white midsole, and black outsole completes the design. This Jordan 1 released in July of 2020 and retailed for $170 USD\",\"content\":null},\"vi\":{\"name\":\"Jordan 1 Retro High Light Smoke Grey\",\"keyword\":\"jordan 1\",\"description\":\"Jordan delivered another new colorway of their most popular silhouette with the Jordan 1 Retro High Light Smoke Grey, now available on StockX. Following a similar reconstructed design language as the Jordan 1 Union LA from 2018, this Jordan 1 utilizes color blocking and different materials to present familiar colors in a unique format.\\r\\n\\r\\nThe Jordan 1 High Light Smoke Grey is composed of a white leather upper with grey suede overlays and a red leather ankle panel. Black suede on the heel paneling and Swoosh, a white midsole, and black outsole completes the design. This Jordan 1 released in July of 2020 and retailed for $170 USD\",\"content\":null}},\"category\":[\"15\"],\"image\":\"\\/data\\/product\\/img01.jpg,\\/data\\/product\\/img02.jpg,\\/data\\/product\\/img32.jpg,\\/data\\/product\\/img21.jpg,\\/data\\/product\\/img12.jpg\",\"sku\":\"555088-1