(4107, 1, 'system/product/edit/3', 'POST', '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/93.0.4577.82 Safari/537.36', '{\"_token\":\"k6nTfSt1dtJEVAhaVexoAH10n7KAoancTEL0sxck\",\"descriptions\":{\"en\":{\"name\":\"adidas Yeezy Boost 350 V2\",\"keyword\":\"adidas,yeezy,boost,350v2\",\"description\":\"Yeezy adds another colorway of its most well-known design with the adidas Yeezy 350 Zyon\",\"content\":\"Yeezy adds another colorway of its most well-known design with the adidas Yeezy 350 Zyon, now available on StockX. This 350 V2 dons a similar pattern as the Static colorway, only this time ditching a white side stripe and grey accents for a darker brown stripe and mocha hues.<br \\/>\\r\\n<br \\/>\\r\\nThis Yeezy 350 V2 is composed of a Zyon Primeknit upper with a dark tonal side stripe. A translucent Boost cushioned sole and cream interior completes the design. These sneakers released in March of 2020 and retailed for $220.\"},\"vi\":{\"name\":\"adidas Yeezy Boost 350 V2\",\"keyword\":\"adidas,yeezy,boost,350v2\",\"description\":\"Yeezy adds another colorway of its most well-known design with the adidas Yeezy 350 Zyon\",\"content\":\"Yeezy adds another colorway of its most well-known design with the adidas Yeezy 350 Zyon, now available on StockX. This 350 V2 dons a similar pattern as the Static colorway, only this time ditching a white side stripe and grey accents for a darker brown stripe and mocha hues.<br \\/>\\r\\n<br \\/>\\r\\nThis Yeezy 350 V2 is composed of a Zyon Primeknit upper with a dark tonal side stripe. A translucent Boost cushioned sole and cream interior completes the design. These sneakers released in March of 2020 and retailed for $220.\"}},\"category\":[\"15\",\"17\"],\"image\":\"\\/storage\\/data\\/product\\/adidas-Yeezy-Boost-350-V2-Zyon\\/adidas-Yeezy-Boost-350-V2-Zyon01.jpg\",\"sub_image\":[\"\\/storage\\/data\\/product\\/adidas-Yeezy-Boost-350-Yeshaya-Reflective\\/adidas-Yeezy-Boost-350-Ye