(5651, 1, 'system/product/create', 'POST', '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/94.0.4606.71 Safari/537.36', '{\"kind\":\"0\",\"_token\":\"TdfcIC9lyAc7neZdxMDgBKdKMjtxzvk3D8du2frG\",\"descriptions\":{\"en\":{\"name\":\"Nike x Drake Certified Lover Boy Cherub T-shirt\",\"keyword\":\"nike,drake,t-shirt\",\"description\":\"Drake\'s collaborative merch capsule with Nike for his new album\",\"content\":\"<section>\\r\\n<p>Drake&#39;s collaborative merch capsule with Nike for his new album, &quot;Certified Lover Boy,&quot; was dropped ahead of the album&#39;s release in October of 2020. The collection&#39;s black Cherub t-shirt features a graphic of a masked cherup with its bow drawn underneath a Nike Swoosh logo on the front and features the name of Drake&#39;s new album on the back of the t-shirt. The collection itself dropped on October 26th, 2020, two days after Drake&#39;s birthday and included twelve items, four of which were for friends and family only. The Nike x Drake Certified Lover Boy Cherub T-shirt in black was released at a retail price of $35 USD.<\\/p>\\r\\n<\\/section>\"},\"vi\":{\"name\":\"\\u00c1o thun Nike x Drake\",\"keyword\":\"\\u00e1othun,nike,xdrake\",\"description\":\"Drake\'s collaborative merch capsule with Nike for his new album\",\"content\":\"<section>\\r\\n<p>Drake&#39;s collaborative merch capsule with Nike for his new album, &quot;Certified Lover Boy,&quot; was dropped ahead of the album&#39;s release in October of 2020. The collection&#39;s black Cherub t-shirt features a graphic of a masked cherup with its bow drawn underneath a Nike Swoosh logo on the front and features the name of Drake&#39;s new album on the back of the t-shirt. The collection itself dropped on October 26th, 2020, two days after Drake&#39;s birthday and included twelve items, four of which were for friends and family only. The Nike x Drake Certified Lover Boy Cherub T-shirt in black was released at a retail price of $35 USD.<\\/p>\\r\\n<\\/section>\"}},\"category\":[\"15\",\"20\"],\"image\":\"\\/storage\\/data\\/product\\/Nike-x-Drake-Certified-Lover-Boy-Cherub-T-Shirt-Black.webp\",\"type_show_image_desc\":\"default\",\"sub_image\":\"\\/storage\\/data\\/product\\/Nike-x-Drake-Certified-Lover-Boy-Cherub-T-Shirt-Black.webp,\\/storage\\/data\\/product\\/Nike-x-Drake-Certified-Lover-Boy-Cherub-T-Shirt-Black-2.webp\",\"sku\":\"FW20\",\"alias\":null,\"brand_id\":\"7\",\"supplier_id\":\"2\",\"cost\":\"85\",\"price\":\"100\",\"tax_id\":\"0\",\"stock\":\"20\",\"minimum\":\"1\",\"download_path\":null,\"property\":\"physical\",\"date_available\":null,\"attribute\":{\"1\":{\"name\":[\"\\u0110en\"],\"add_price\":[\"10\"],\"type_show\":[\"default\"],\"images\":[\"\\/storage\\/data\\/product\\/Nike-x-Drake-Certified-Lover-Boy-Cherub-T-Shirt-Black.webp,\\/storage\\/data\\/product\\/Nike-x-Drake-Certified-Lover-Boy-Cherub-T-Shirt-Black-2.webp\"],\"code\":[\"#3d3c3c,#0a0a0a,#9c9c9c\"]},\"2\":{\"name\":[\"S\",\"M\",\"X\",\"XL\"],\"add_price\":[\"0\",\"0\",\"0\",\"0\"]}},\"weight_class\":\"oz\",\"weight\":\"0\",\"length_class\":\"in\",\"length\":\"0\",\"height\":\"0\",\"width\":\"0\",\"sort\":\"3\",\"status\":\"on\"}', '2021-10-08 19:37:21', '2021-10-08 19:37:21'),
