INSERT INTO `bc_shop_page_description` (`page_id`, `lang`, `title`, `keyword`, `description`, `content`) VALUES
(1, 'en', 'About', NULL, NULL, '<div class=\"container\">\r\n<div class=\"row p-b-148\">\r\n<div class=\"col-md-7 col-lg-8\">\r\n<div class=\"p-t-7 p-r-85 p-r-15-lg p-r-0-md\">\r\n<h3 class=\"mtext-111 cl2 p-b-16\">Our Story</h3>\r\n\r\n<p class=\"stext-113 cl6 p-b-26\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris consequat consequat enim, non auctor massa ultrices non. Morbi sed odio massa. Quisque at vehicula tellus, sed tincidunt augue. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Maecenas varius egestas diam, eu sodales metus scelerisque congue. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Maecenas gravida justo eu arcu egestas convallis. Nullam eu erat bibendum, tempus ipsum eget, dictum enim. Donec non neque ut enim dapibus tincidunt vitae nec augue. Suspendisse potenti. Proin ut est diam. Donec condimentum euismod tortor, eget facilisis diam faucibus et. Morbi a tempor elit.</p>\r\n\r\n<p class=\"stext-113 cl6 p-b-26\">Donec gravida lorem elit, quis condimentum ex semper sit amet. Fusce eget ligula magna. Aliquam aliquam imperdiet sodales. Ut fringilla turpis in vehicula vehicula. Pellentesque congue ac orci ut gravida. Aliquam erat volutpat. Donec iaculis lectus a arcu facilisis, eu sodales lectus sagittis. Etiam pellentesque, magna vel dictum rutrum, neque justo eleifend elit, vel tincidunt erat arcu ut sem. Sed rutrum, turpis ut commodo efficitur, quam velit convallis ipsum, et maximus enim ligula ac ligula.</p>\r\n\r\n<p class=\"stext-113 cl6 p-b-26\">Any questions? Let us know in store at 8th floor, 379 Hudson St, New York, NY 10018 or call us on (+1) 96 716 6879</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-11 col-md-5 col-lg-4 m-lr-auto\">\r\n<div class=\"how-bor1 \">\r\n<div class=\"hov-img0\"><img alt=\"IMG\" src=\"/data/product/about-01.jpg\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"order-md-2 col-md-7 col-lg-8 p-b-30\">\r\n<div class=\"p-t-7 p-l-85 p-l-15-lg p-l-0-md\">\r\n<h3 class=\"mtext-111 cl2 p-b-16\">Our Mission</h3>\r\n\r\n<p class=\"stext-113 cl6 p-b-26\">Mauris non lacinia magna. Sed nec lobortis dolor. Vestibulum rhoncus dignissim risus, sed consectetur erat. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Nullam maximus mauris sit amet odio convallis, in pharetra magna gravida. Praesent sed nunc fermentum mi molestie tempor. Morbi vitae viverra odio. Pellentesque ac velit egestas, luctus arcu non, laoreet mauris. Sed in ipsum tempor, consequat odio in, porttitor ante. Ut mauris ligula, volutpat in sodales in, porta non odio. Pellentesque tempor urna vitae mi vestibulum, nec venenatis nulla lobortis. Proin at gravida ante. Mauris auctor purus at lacus maximus euismod. Pellentesque vulputate massa ut nisl hendrerit, eget elementum libero iaculis.</p>\r\n\r\n<div class=\"bor16 p-l-29 p-b-9 m-t-22\">\r\n<p class=\"stext-114 cl6 p-r-40 p-b-11\">Creativity is just connecting things. When you ask creative people how they did something, they feel a little guilty because they didn&#39;t really do it, they just saw something. It seemed obvious to them after a while.</p>\r\n<span class=\"stext-111 cl8\"> - Steve Job&rsquo;s </span></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"order-md-1 col-11 col-md-5 col-lg-4 m-lr-auto p-b-30\">\r\n<div class=\"how-bor2\">\r\n<div class=\"hov-img0\"><img alt=\"IMG\" src=\"/data/product/about-02.jpg\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
