INSERT INTO `bc_shop_product_description` (`product_id`, `lang`, `name`, `keyword`, `description`, `content`) VALUES
(2, 'en', 'Jordan 1 Mid', 'jordan 1 mid,jordan,nike', 'The Jordan 1 Mid Sail Red is hit with a hodgepodge of materials.', 'The Jordan 1 Mid Sail Red is hit with a hodgepodge of materials. The upper holds a mix of leather, corduroy, and metal. Gold stitching appears throughout the sneaker&rsquo;s structure, while Chile Red and black leather clash on the heel and toe. A blue felt Swoosh offers an additional pop of color on the mid sneaker. The women&#39;s Jordan 1 Mid Sail Red (W) released in November of 2020 for $130.'),
(2, 'vi', 'Jordan 1 Mid', 'jordan 1 mid,jordan,nike', 'The Jordan 1 Mid Sail Red is hit with a hodgepodge of materials.', 'The Jordan 1 Mid Sail Red is hit with a hodgepodge of materials. The upper holds a mix of leather, corduroy, and metal. Gold stitching appears throughout the sneaker&rsquo;s structure, while Chile Red and black leather clash on the heel and toe. A blue felt Swoosh offers an additional pop of color on the mid sneaker. The women&#39;s Jordan 1 Mid Sail Red (W) released in November of 2020 for $130.'),
(4, 'en', 'adidas Yeezy Boost 350 V2', 'adidas,yeezy,boost,350v2', 'adidas Yeezy Boost 350 V2', 'adidas Yeezy Boost 350 V2'),
(4, 'vi', 'adidas Yeezy Boost 350 V2', 'adidas,yeezy,350v2 ultraboost', 'adidas Yeezy Boost 350 V2', 'adidas Yeezy Boost 350 V2'),
(5, 'en', 'Nike x Drake Certified Lover Boy Cherub T-shirt', 'nike,drake,t-shirt', 'Drake\'s collaborative merch capsule with Nike for his new album', '<section>\r\n<p>Drake&#39;s collaborative merch capsule with Nike for his new album, &quot;Certified Lover Boy,&quot; was dropped ahead of the album&#39;s release in October of 2020. The collection&#39;s black Cherub t-shirt features a graphic of a masked cherup with its bow drawn underneath a Nike Swoosh logo on the front and features the name of Drake&#39;s new album on the back of the t-shirt. The collection itself dropped on October 26th, 2020, two days after Drake&#39;s birthday and included twelve items, four of which were for friends and family only. The Nike x Drake Certified Lover Boy Cherub T-shirt in black was released at a retail price of $35 USD.</p>\r\n</section>'),
(5, 'vi', 'Áo thun Nike x Drake', 'áothun,nike,xdrake', 'Drake\'s collaborative merch capsule with Nike for his new album', '<section>\r\n<p>Drake&#39;s collaborative merch capsule with Nike for his new album, &quot;Certified Lover Boy,&quot; was dropped ahead of the album&#39;s release in October of 2020. The collection&#39;s black Cherub t-shirt features a graphic of a masked cherup with its bow drawn underneath a Nike Swoosh logo on the front and features the name of Drake&#39;s new album on the back of the t-shirt. The collection itself dropped on October 26th, 2020, two days after Drake&#39;s birthday and included twelve items, four of which were for friends and family only. The Nike x Drake Certified Lover Boy Cherub T-shirt in black was released at a retail price of $35 USD.</p>\r\n</section>'),
(6, 'en', 'Denim Tears Levis Cotton Wreath Jeans', 'jean,Levi\'s', 'You are committing to ship your item within the standard 2-day shipping window', 'By listing this item for sale, you are committing to ship your item within the standard 2-day shipping window. Deadlines will not be extended to accommodate shipping delays from the retailer.'),
(6, 'vi', 'Quần jean Tear Levis', 'quần,jeans,tear,Levi\'s', 'You are committing to ship your item within the standard 2-day shipping window', 'By listing this item for sale, you are committing to ship your item within the standard 2-day shipping window. Deadlines will not be extended to accommodate shipping delays from the retailer.'),
(8, 'en', 'Group product discount', 'discount', 'this is description', ''),
